import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import Button from 'react-bootstrap/Button';
import ItemForm from "./ItemForm";
import './resources/Form.css'

const Cough = ({ setForm, formData, navigation }) => {
  const { nej, ibland, state, zip } = formData;

  const { previous, next } = navigation;

  return (
    <div className="form">
      <h3>Har du nyligen b√∂rjat hosta?</h3>
      <ItemForm label="nej" name="nej" value={nej} onChange={setForm} />
      <ItemForm label="Ja. Hostar ibland" name="ibland" value={ibland} onChange={setForm} />
      <ItemForm label="Zip" name="zip" value={zip} onChange={setForm} />
      <div>
        <Button onClick={previous}>Previous</Button>{' '}
        <Button onClick={next}>Next</Button>
      </div>
    </div>
  );
};

export default Cough;
